      /> */}
    </div>
  )
}


Ads = styled(Ads)`
  box-shadow: var(--shadow-sm);  
  width: 100%;
  border-radius: 10px;
  grid-area: ads;
  border-radius: 10px;
  background: var(--grey-light);
  background-image: url("/data.jpg");
  background-position: cover;
`

export default  Ads
